    const {data} = useMeQuery({fetchPolicy: 'network-only'})

    return (
        <header>  
        <div>
          <Link to="/">home</Link>
        </div>
        <div>
          <Link to="/register">register</Link>
        </div>
        <div>
          <Link to="/login">login</Link>
        </div>
        <div>
          <Link to="/bye">bye</Link>
        </div>
        {data && data.me ? (<div> Du bist eingelogged als: {data.me.email} </div>) : null}
      </header>
        )
}
